import React, {useState, useEffect} from 'react'
import {useNavigate} from 'react-router-dom'

const Filtering = () => {

    let navigate = useNavigate()
    let [filterLink, setFilterLink] = useState('')


    let freeID = document.querySelector('#free')
    let masterID = document.querySelector('#master')


    let filterNavigate = () => {
        navigate(`/${filterLink}`)
    }
    console.log(filterLink)


    let addFilter = () => {
        
        // setFilterLink(filterLink => [...filterLink, e.target.value])        
        if(freeID.checked){
            console.log('klikniete')
        }
    }

    useEffect(() => {
        addFilter()
    })

    
  return (
    <div >
        <div className="form-check form-check-inline">
            <input className="form-check-input" type="checkbox" id="free" value="free" onChange={useEffect()}/>
            <label className="form-check-label" htmlFor="inlineCheckbox1">Free</label>
        </div>
        <div className="form-check form-check-inline">
            <input className="form-check-input" type="checkbox" id="master" value="master" onChange={useEffect()}/>
            <label className="form-check-label" htmlFor="inlineCheckbox2">Master</label>
        </div>
        
    </div>
  )
}

export default Filtering
